/*----------------------------------------------------------------------------*/
# 80105A80 (offset 0x18F0): [w] RRS event schedule (Z64 0x6AED0)
# despite being a word, we treat it as 4 bytes, split up as follows:

# 0x00 - bulletin board message, event flags
# 76543210
# |__|||||
#   | |||+-- Event Location upper bit
#   | ||+--- Qualifying requirement?
#   | |+---- Tour Opening Scene
#   | +----- Promotion/Relegation takes place after event
#   |
#   +------- Bulletin Board message

# 0x01 - event location, arena type, player participation
# 76543210
# |__|||||
#   | |||+-- Player has singles match on this card
#   | ||+--- Player has tag match on this card
#   | ++---- Arena type
#   +------- Event Location lower bits

# 0x02 - show number, booking instructions
# 76543210
# |__||__|
#   |   |
#   |   +---- show number
#   +-------- booking instructions (index into seg002:801702E0)

# show number values
# 0 = opening event
# 1-4 = (event number + 1)
# 5 = main event
# 6 = league match
# 7 = deciding match
# 8 = 1 day event
# 9 = ??? (not used)
# A = ??? (used at year end)
# (B-F unused?)

# 0x03 - event name and month number
# 76543210
# |__||__|
#   |   |
#   |   +-- Month number
#   +------ Event name

# Event name values
# 0 = super power series
# 1 = summer action series
# 2 = summer action series 2
# 3 = fan appreciation day
# 4 = giant series
# 5 = world strongest tag league
# 6 = new year giant series
# 7 = excite series
# 8 = champion carnival
# 9 = Dome Event
# A = year end
# (B-F unused?)

# month numbers make sense from 0 (January) to 0xB (December); 0xC = "finished"

tbl0_EventScheduleRRS:
	.byte 0xFF, 0xFF, 0xFF, 0xFF

	.byte 0x14, 0x09, 0x00, 0x04
